export function CarBrandCard({ brand, img, onSelect }) {
  return (
    <div onClick={onSelect} style={{ cursor: "pointer", border: "1px solid #ccc", padding: 10, width: 120, textAlign: "center" }}>
      <img src={img} alt={brand} style={{ width: "100px", height: "100px", objectFit: "contain" }} />
      <p>{brand}</p>
    </div>
  );
}
